jQuery(document).ready(function () {    


    jQuery('.main-menu li').each(function () {
        jQuery(this).click(function () {
            jQuery(this).addClass('open');
            jQuery(this).siblings().removeClass('open');
            jQuery(this).siblings().children().removeClass('open');
            jQuery(this).children('ul').slideDown();
            jQuery(this).siblings().children('ul').slideUp();
            if (jQuery('#make-board').hasClass('open')) {
                stage.listening(true);
            } else {
                jQuery('canvas').each(function () {
                    stage.listening(false);
                });
            }

        });
    });
    jQuery('[data-target]').each(function () {
        jQuery(this).click(function () {
            var a = jQuery(this).attr('data-target');
            jQuery(document).find('#' + a).addClass('open');
            jQuery(document).find('#' + a).siblings().removeClass('open');
            // console.log(a + " = payment-detail ");
            if (a === 'payment-detail') {
                // alert('test');
                jQuery('#payment-detail').fadeIn();
                setTimeout(() => { jQuery('#payment-detail .payment-form').slideDown() }, 500);
            }
        });

    });
    jQuery('#payment-detail .payment-form .close').each(function () {
        jQuery(this, "#payment-detail").click(() => {
            jQuery("#payment-detail .payment-form").slideUp(500);
            setTimeout(() => {
                jQuery('#payment-detail').fadeOut();
            }, 500);
        });
    });
    jQuery('.tabs li').each(function () {
        jQuery(this).click(function () {
            jQuery(this).addClass('active');
            jQuery(this).siblings().removeClass('active');
        });
    });
    jQuery(document).on('click', '#update-btn', function (e) {
        e.preventDefault();
        var oldpass = jQuery('#old-psw').val();
        var newpass = jQuery('#new-psw').val();
        if (oldpass == '') {
            jQuery('.oldpass-error').text('Please Enter Your Old Password');
        } else {

            jQuery('.oldpass-error').text('');
        }
        if (newpass == '') {
            jQuery('.newpass-error').text('Please Enter Your New Password');
        } else {

            jQuery('.newpass-error').text('');
        }
        if (oldpass == '' || newpass == '') {
            return false;
        }
        var data = new FormData(document.getElementById("password_change"));
        data.append('action', 'password_change');
        jQuery.ajax({
            type: "POST",
            url: bb_ajax_object.ajax_url,
            data: data,
            datatype: 'json',
            contentType: false,
            cache: false,
            processData: false,
            success: function (data) {
                var result = JSON.parse(data);
            },
            error: function (error) {
                jQuery(".my_form_error").html(error);
                jQuery(".my_form_error").css("display", "block");
            }
        });
    });


});


