        jQuery('.multi-shapes-wrpper input[type="radio"]:checked').attr('data-attr-color', a);
        jQuery('.multi-shapes-wrpper input[type="radio"]:checked').attr('data-attr-id', b);
        let name = jQuery('.multi-shapes-wrpper input[type="radio"]:checked').val();
