jQuery("#export-design").click(function (e) {

    var get_data_array = get_all_selected_options();
    var canvas = document.getElementsByTagName("canvas");
    var dataURL = canvas[0].toDataURL("image/png").replace("image/png", "image/octet-stream");
    var imgData = canvas[0].toDataURL("image/jpeg", 1.0);
    var pdf = new jsPDF();

    pdf.setFontSize(15)
    var pageHeight= pdf.internal.pageSize.height
    var custom_height = 10;
    for (var i = 0; i < get_data_array.length; i++) {

        if (custom_height >= pageHeight){
          pdf.addPage();
          custom_height = 10 // Restart height position
        }
        pdf.text(5, custom_height, get_data_array[i])
        custom_height = custom_height + 10;
    }
    
    if (custom_height >= pageHeight){
      pdf.addPage();
      custom_height = 10 // Restart height position
    }
    pdf.addImage(imgData, 'JPEG', 5, custom_height, 200, 0);
    pdf.save("designdownload.pdf");
});

