function selectEmb(embVar, shapeKey) {
    embVar.show();
    embVar.setData(shapes[shapeKey]);
    letterCount(textCount);
    layer.add(embVar);
    layer.draw();
    letterCount(textCount);
}

function removeEmb(embVar) {
    embVar.hide();
    layer.draw();
    letterCount(textCount);
}

function colorEmb(embVar, color) {
    embVar.setFill(color);
    layer.draw();
}

function letterCount(textCount) {
    var c;
    var price;
    var embCount = 0;
    if (embFlower.isVisible()) {
        embCount = embCount + 1;
    }
    if (embCactus.isVisible()) {
        embCount = embCount + 1;
    }
    if (embWreaths.isVisible()) {
        embCount = embCount + 1;
    }
    var textOneLetters = jQuery('#text-one').val();
    var textTwoLetters = jQuery('#text-two').val();
    var letterCount = textOneLetters.length + textTwoLetters.length;
    var remain;
    jQuery('#text-two').keyup(function () {
        textOneLetters = jQuery('#text-one').val();
        textTwoLetters = jQuery('#text-two').val();
        textTwo.setText(textTwoLetters);
        var c = textOneLetters.length;
        remain = textCount - c;
        jQuery(this).attr('maxlength', remain);
        letterCount = textOneLetters.length + textTwoLetters.length;
        jQuery("span.count").each(function () { jQuery(this).text(letterCount) });
        jQuery("span.remain").each(function () { jQuery(this).text("(" + (textCount - letterCount) + " left)") });
        jQuery("#text-on-board span").text(textOneLetters + " " + textTwoLetters);
        layer.draw();
    });
    jQuery('#text-one').keyup(function () {
        textOneLetters = jQuery('#text-one').val();
        textTwoLetters = jQuery('#text-two').val();
        textOne.setText(textOneLetters);
        var c = textTwoLetters.length;
        remain = textCount - c;
        jQuery(this).attr('maxlength', remain);
        letterCount = textOneLetters.length + textTwoLetters.length;
        jQuery("span.count").each(function () { jQuery(this).text(letterCount) });
        jQuery("span.remain").each(function () { jQuery(this).text("(" + (textCount - letterCount) + " left)") });
        jQuery("#text-on-board span").text(textOneLetters + " " + textTwoLetters);
        layer.draw();

    });
    price = calcPrice(letterCount, letter_price, embCount, embellishment_price);
    jQuery("#Price-of-board span, #total-price-on-preview").text(price + "$");
}

function calcPrice(letterCount, letterPrice, embCount, embPrice) {
    var price;
    price = (letterCount * letterPrice) + (embCount * embPrice);
    return price;
}


function fitStageIntoParent() {
    var container = document.querySelector('#canvas');
    var containerWidth = container.offsetWidth;
    var scale = containerWidth / stageWidth;
    stage.width(stageWidth * scale);
    stage.height(stageHeight * scale);
    stage.scale({ x: scale, y: scale });
    stage.draw();

    window.addEventListener('resize', fitStageIntoParent);
}
fitStageIntoParent();

function on() {
    document.getElementById("overlay").style.display = "block";
}

function off() {
    document.getElementById("overlay").style.display = "none";
} 
